import React, {Component, Fragment} from "react";
import Layout from './Layout';
import NagdaAlert from '../components/Alert';

class Page extends Component {

    componentDidMount() {
    }

    render() {
        return (
            <Fragment>
                <Layout>
                    {this.props.children}
                    <NagdaAlert variant="danger" width="400px" height="50px"/>
                </Layout>
            </Fragment>
        );
    }
}


export default Page;
